
function audioplayer(ty, input){
    var sys = (window.AudioContext || window.webkitAudioContext);
    var ctx = new sys();
    
    var state = {
        buf: null,
        node: null,
        flag: false,
        stopped: false,
        marker: 0,
        origin: 0,
        pianoNote: "data:audio/mpeg;base64,",
    };
    
    function load(b64){
        var raw = b64.split(",")[1];
        var bin = atob(raw);
        var temp = new Uint8Array(bin.length);
        for (var i = 0; i < bin.length; i++){
            temp[i] = bin.charCodeAt(i);
        }
        ctx.decodeAudioData(temp.buffer, function(b){
            state.buf = b;
        },
        function(e){
            console.log(e);
        });
        
    }
    
    function play(){
        if(!state.buf || state.flag) return;
        
        var restart = state.marker > 0 ? state.marker: 0;
        state.origin = ctx.currentTime - restart;
        var pulse = ctx.createBufferSource();
        pulse.buffer = state.buf;
        pulse.connect(ctx.destination);
        pulse.onended = function(){
            state.flag = false;
            if(!state.stopped){
                state.marker = 0;
            }
            state.stopped = false;
        };
        pulse.start(0, restart);
        
        state.node = pulse;
        state.flag = true;
    }
    
    function pause(){
        if(!state.flag || !state.node) return;
        state.stopped = true;
        state.marker = ctx.currentTime - state.origin;
        state.node.stop();
        state.flag = false;
    }
    function toggle(){
        if(state.flag) {
            pause();
        } else {
            play();
        }
    }
    function reset(t){
        if(state.node) {
            state.node.stop();
        }
        state.marker = (t || 0);
        state.flag = false;
    }
    function playNote(freq, velocity, dur,offset) {
        if (!state.buf) return;
        var pulse = ctx.createBufferSource();
        pulse.buffer = state.buf;
        
        pulse.playbackRate.value = Math.pow(2, (freq-60) / 12);
        
        var gainNode = ctx.createGain();
        gainNode.gain.value = velocity*4;
        
        pulse.connect(gainNode);
        gainNode.connect(ctx.destination);
        
        pulse.start(offset);
        pulse.stop(ctx.currentTime + offset + dur);
    
    };
    function decodeMidi(midiData){
        return midiData.split(";").map(entry => {
    const [m, v, d, t] = entry.split(",").map(x => parseInt(x, 16));//this decoding was by chatgpt, might change later

        return {
        midi: m,
        velocity: v / 100,       
        duration: d / 1000,     
        time: t / 1000        
        };
  });
    }
    function playMidi(midiData){
            var mididata = decodeMidi(midiData);
            mididata.forEach(note => {
                var  midi = note.midi, velocity = note.velocity, duration = note.duration, time = note.time;
                playNote(midi, velocity, duration, time);
            });
        
    };
    if(ty == "base64"){
        load(input);
    } else if (ty == "piano"){
        load(state.pianoNote);
    }
    
    return {
        play: play,
        pause: pause,
        toggle: toggle,
        reset: reset,
        playNote: playNote,
        playMidi: playMidi,
    }
}
